<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Singleâ€‘File Image Viewer</title>
  <style>
    :root {
      --bg: #0d0f12;
      --fg: #d6dde6;
      --muted: #99a3b3;
    }
    html, body { height: 100%; }
    body {
      margin: 0;
      background: var(--bg);
      color: var(--fg);
      font-family: system-ui, -apple-system, Segoe UI, Roboto, Ubuntu, Cantarell, Noto Sans, Arial, "Apple Color Emoji", "Segoe UI Emoji";
      overflow: hidden; /* prevent page scroll */
    }

    /* Full-viewport stage */
    #viewer {
      position: fixed;
      inset: 0;
      background: radial-gradient(1200px 1200px at 50% 50%, #101319 0%, #0d0f12 60%, #0a0b0e 100%);
      user-select: none;
      cursor: default;
    }

    /* The image is absolutely positioned at (0,0) and transformed. */
    #stage {
      position: relative;
      width: 100%;
      height: 100%;
      overflow: hidden; /* where we clamp */
    }

    #img {
      position: absolute;
      top: 0; left: 0;
      transform-origin: 0 0; /* crucial for math */
      will-change: transform;
      image-rendering: auto; /* crisp scaling */
      max-width: none; /* we control size via transform */
      max-height: none;
      pointer-events: none; /* dragging handled on container */
    }

    /* Minimal HUD */
    #hud {
      position: fixed;
      left: 12px; bottom: 12px;
      padding: 6px 10px;
      background: rgba(0,0,0,0.45);
      border: 1px solid rgba(255,255,255,0.07);
      border-radius: 10px;
      font-size: 12px;
      letter-spacing: .2px;
      color: var(--muted);
      backdrop-filter: blur(6px);
      -webkit-backdrop-filter: blur(6px);
    }
    #hud kbd {
      background: rgba(255,255,255,0.08);
      border: 1px solid rgba(255,255,255,0.15);
      border-bottom-color: rgba(0,0,0,0.3);
      border-radius: 6px;
      padding: 2px 5px;
      font-family: ui-monospace, SFMono-Regular, Menlo, Consolas, monospace;
      color: var(--fg);
    }

    /* Cursor hints while panning */
    .space-held { cursor: grab; }
    .panning    { cursor: grabbing; }

    /* Optional: file picker (no external assets needed) */
    #loader {
      position: fixed;
      right: 12px; bottom: 12px;
      background: rgba(0,0,0,0.45);
      border: 1px solid rgba(255,255,255,0.07);
      border-radius: 10px;
      padding: 6px 10px;
      font-size: 12px;
      color: var(--muted);
      backdrop-filter: blur(6px);
      -webkit-backdrop-filter: blur(6px);
    }
    #file { display: none; }
    #pick {
      appearance: none;
      border: 1px solid rgba(255,255,255,0.15);
      background: rgba(255,255,255,0.08);
      color: var(--fg);
      border-radius: 8px;
      padding: 6px 10px;
      font-size: 12px;
      cursor: pointer;
    }
  </style>
</head>

  <div id="hud" aria-live="polite">
    <div><strong>Zoom</strong>: hold <kbd>Ctrl</kbd> + mouse wheel (10%â€“500%)</div>
    <div><strong>Pan</strong>: hold <kbd>Space</kbd> + drag</div>
    <div id="zoomLabel">100%</div>
  </div>

  <div id="loader">
    <button id="pick" type="button">Open imageâ€¦</button>
    <input id="file" type="file" accept="image/*" />
  </div>

  <script>
  (function () {
    const viewer = document.getElementById('viewer');
    const stage  = document.getElementById('stage');
    const img    = document.getElementById('img');
    const zoomLabel = document.getElementById('zoomLabel');
    

    const fileInput = document.getElementById('file');
    const pickBtn   = document.getElementById('pick');

    // ---- State ----
    let naturalW = 1000, naturalH = 800; // fallback until image loads
    let scale = 1;                 // current zoom
    const MIN_SCALE = 0.10;        // 10%
    const MAX_SCALE = 5.00;        // 500%
    const ALLOW_PAN_WHEN_FIT = true;
    let tx = 0, ty = 0;            // current translation (px)
    let spaceHeld = false;         // whether Space is down
    let panning = false;           // currently dragging
    let dragStartX = 0, dragStartY = 0;
    let startTX = 0, startTY = 0;

    function setZoomLabel() {
      zoomLabel.textContent = Math.round(scale * 100) + '%';
    }

    function applyTransform() {
      img.style.transform = `translate(${tx}px, ${ty}px) scale(${scale})`;
      setZoomLabel();
    }

    function clampTranslation() {
  const vw = stage.clientWidth, vh = stage.clientHeight;
  const w  = naturalW * scale,  h  = naturalH * scale;

  const range = (imgSize, viewSize) => {
    if (ALLOW_PAN_WHEN_FIT) {
      // allow sliding image inside the window, but never past the edges
      const min = Math.min(0, viewSize - imgSize);
      const max = Math.max(0, viewSize - imgSize);
      return [min, max];
    } else {
      // lock to center if image is smaller than the window
      if (imgSize <= viewSize) {
        const c = (viewSize - imgSize) / 2;
        return [c, c];
      }
      return [viewSize - imgSize, 0];
    }
  };

  const [minX, maxX] = range(w, vw);
  const [minY, maxY] = range(h, vh);

  tx = Math.min(Math.max(tx, minX), maxX);
  ty = Math.min(Math.max(ty, minY), maxY);
    }

    function fitToView(initial = false) {
      // Fit whole image inside viewport, but don't upscale above 100% on initial load.
      const vw = stage.clientWidth;
      const vh = stage.clientHeight;
      const s = Math.min(vw / naturalW, vh / naturalH);
      scale = initial ? Math.min(1, s) : Math.max(MIN_SCALE, Math.min(MAX_SCALE, s));
      // Center
      tx = (vw - naturalW * scale) / 2;
      ty = (vh - naturalH * scale) / 2;
      applyTransform();
    }

    function zoomAt(pointX, pointY, zoomDelta) {
      // zoomDelta: positive for zoom in, negative for out (wheel deltaY inverted)
      const prev = scale;
      // Use exponential wheel scaling for smoothness
      const next = Math.max(MIN_SCALE, Math.min(MAX_SCALE, prev * Math.pow(1.0015, zoomDelta)));
      if (next === prev) return;

      // Keep the point under cursor stationary: solve for new translation
      // px = tx + x * prev  => x = (px - tx) / prev
      const x = (pointX - tx) / prev;
      const y = (pointY - ty) / prev;

      scale = next;
      tx = pointX - x * scale;
      ty = pointY - y * scale;
      clampTranslation();
      applyTransform();
    }

    // ---- Events ----
    window.addEventListener('resize', () => {
      clampTranslation();
      applyTransform();
    });

    // Wheel zoom only when Ctrl is held
    viewer.addEventListener('wheel', (e) => {
      if (!e.ctrlKey) return; // ignore regular wheel
      e.preventDefault(); // allow pinch-to-zoom (Ctrl+wheel) without page zoom
      const rect = stage.getBoundingClientRect();
      const px = e.clientX - rect.left;
      const py = e.clientY - rect.top;
      // Invert deltaY (natural: wheel up -> negative)
      zoomAt(px, py, -e.deltaY);
    }, { passive: false });

    // Space to pan
    window.addEventListener('keydown', (e) => {
      if (e.code === 'Space' && !spaceHeld) {
        spaceHeld = true;
        e.preventDefault();
        viewer.classList.add('space-held');
      }
    });
    window.addEventListener('keyup', (e) => {
      if (e.code === 'Space') {
        spaceHeld = false;
        viewer.classList.remove('space-held');
      }
    });

    // Dragging when Space is held
    stage.addEventListener('mousedown', (e) => {
      if (!spaceHeld) return;
      e.preventDefault();
      panning = true;
      viewer.classList.add('panning');
      dragStartX = e.clientX;
      dragStartY = e.clientY;
      startTX = tx;
      startTY = ty;
    });

    window.addEventListener('mousemove', (e) => {
      if (!panning) return;
      const dx = e.clientX - dragStartX;
      const dy = e.clientY - dragStartY;
      tx = startTX + dx;
      ty = startTY + dy;
      clampTranslation();
      applyTransform();
    });

    window.addEventListener('mouseup', () => {
      if (!panning) return;
      panning = false;
      viewer.classList.remove('panning');
    });

    // Prevent the browser's page zoom on Ctrl+wheel (we handle it) while the pointer is over viewer
    window.addEventListener('wheel', (e) => {
      if (e.ctrlKey && e.target.closest && e.target.closest('#viewer')) {
        e.preventDefault();
      }
    }, { passive: false });

    // ---- Image loading helpers ----
    function loadBlob(file) {
      const url = URL.createObjectURL(file);
      img.onload = () => {
        URL.revokeObjectURL(url);
        naturalW = img.naturalWidth;
        naturalH = img.naturalHeight;
        fitToView(true);
      };
      img.src = url;
    }

    pickBtn.addEventListener('click', () => fileInput.click());
    fileInput.addEventListener('change', () => {
      const f = fileInput.files && fileInput.files[0];
      if (f) loadBlob(f);
    });

    // Drag & drop (optional quality-of-life; no external files written)
    ;['dragenter','dragover'].forEach(ev => viewer.addEventListener(ev, (e) => {
      e.preventDefault();
    }));
    viewer.addEventListener('drop', (e) => {
      e.preventDefault();
      const f = e.dataTransfer.files && e.dataTransfer.files[0];
      if (f && f.type.startsWith('image/')) loadBlob(f);
    });

    // If an embedded data URL is already set in the <img>, initialize from it.
    function initFromExistingSrc() {
      if (!img.src) return; // nothing embedded
      const probe = new Image();
      probe.onload = () => {
        naturalW = probe.naturalWidth;
        naturalH = probe.naturalHeight;
        // Copy the src back to the live <img> after we know dimensions
        img.src = probe.src;
        fitToView(true);
      };
      probe.src = img.src;
    }

    // Start with a neutral empty state; if you embed a base64 JPG, this will fit it.
    initFromExistingSrc();
  })();
  </script>
</body>
</html>
